import React from "react";
import styled from "styled-components";
import m3 from "assets/3.jpg";
import m4 from "assets/4.jpg";
import m5 from "assets/5.jpg";
import m6 from "assets/6.jpg";

const Container = styled.div`
    height: 100vh;
    overflow: auto;
    display: grid;
    place-items: center;
    grid-template-columns: 1fr 1fr;
`;
const ImgBox = styled.div`
    position: relative;
    height: 700px;
    width: 700px;
    object-fit: cover;
    background-size: cover;
    background-repeat: no-repeat;
    background-image: url(${(props) => props.img});
    border-radius: 20px;
`;
const Message = styled.div`
    position: absolute;
    bottom: 0;
    width: 100%;
    height: 30%;
    background-color: white;
    opacity: 0.9;
    border-radius: 20px;
`;

const FundingPresenter = () => {
    return (
        <Container>
            <ImgBox img={m3}>
                <Message></Message>
            </ImgBox>
            <ImgBox img={m4}></ImgBox>
            <ImgBox img={m5}></ImgBox>
            <ImgBox img={m6}></ImgBox>
        </Container>
    );
};

export default FundingPresenter;
